package arrayAndHashing;

import java.nio.charset.Charset;
import java.util.HashMap;
import java.util.Map;
import java.util.PrimitiveIterator;

public class ValidAnagram
{
	static void main()
	{
		String s=
			"";
		String t=
			"";
		boolean isAnagram = isAnagram1(s, t);
		System.out.println(isAnagram);
	}

	private static boolean isAnagram(String s, String t)
	{
		Map<Byte, Integer> bytesInFirstString = new HashMap();
		Map<Byte, Integer> bytesInSecondString = new HashMap();

		PrimitiveIterator.OfInt iterator = s.chars().iterator();
		while (iterator.hasNext())
		{
			byte c = iterator.next().byteValue();
			bytesInFirstString.put(c, bytesInFirstString.get(c) == null ? 1 : bytesInFirstString.get(c) + 1);
		}

		PrimitiveIterator.OfInt iterator1 = t.chars().iterator();
		while (iterator1.hasNext())
		{
			byte c = iterator1.next().byteValue();
			bytesInSecondString.put(c, bytesInSecondString.get(c) == null ? 1 : bytesInSecondString.get(c) + 1);
		}

		if (bytesInFirstString.size() != bytesInSecondString.size())
			return false;
		else if (!bytesInFirstString.keySet().equals(bytesInSecondString.keySet()))
			return false;
		else
		{
			for (Byte bytes : bytesInFirstString.keySet())
			{
				if (!bytesInFirstString.get(bytes).equals(bytesInSecondString.get(bytes)))
					return false;
			}
		}

		return true;
	}

	private static boolean isAnagram1(String s, String t)
	{
		if (s.length() != t.length())
			return false;

		int[] count = new int[26];
		for (int i = 0; i < s.length(); i++)
		{
			count[s.charAt(i) - 'a']++;
			count[t.charAt(i) - 'a']--;
		}

		for (int i = 0; i < count.length; i++)
		{
			if (count[i] != 0)
				return false;
		}
		return true;
	}
}
